<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>HWID Generator</title>
    <style>
        :root {
            --bg: #0d1117;
            --card: #161b22;
            --border: #30363d;
            --accent: #238636;
            --accent-hover: #2ea043;
            --text: #c9d1d9;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Helvetica, Arial, sans-serif;
            background-color: var(--bg);
            color: var(--text);
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
        }

        .container {
            background: var(--card);
            border: 1px solid var(--border);
            border-radius: 8px;
            padding: 24px;
            width: 90%;
            max-width: 500px; 
            text-align: center;
        }

        h1 {
            font-size: 20px;
            margin-bottom: 20px;
            color: #fff;
        }

        .hwid-display {
            background: #000;
            border: 1px solid var(--border);
            border-radius: 6px;
            padding: 15px;
            font-family: monospace;
            font-size: 14px;
            margin-bottom: 16px;
            min-height: 20px;
            color: #8b949e;
            word-break: normal;
            overflow-wrap: anywhere;
            white-space: normal;
            line-height: 1.4;
        }

        .btn-group {
            display: flex;
            gap: 10px;
        }

        button {
            flex: 1;
            background-color: var(--accent);
            color: white;
            border: 1px solid rgba(27, 31, 35, 0.15);
            padding: 12px 16px;
            font-size: 14px;
            font-weight: 600;
            border-radius: 6px;
            cursor: pointer;
            transition: 0.2s;
        }

        button:hover { background-color: var(--accent-hover); }

        #btn-copy {
            background-color: #21262d;
            border: 1px solid var(--border);
            display: none;
        }

        #btn-copy:hover { background-color: #30363d; }

        .success-msg {
            font-size: 12px;
            color: #3fb950;
            margin-top: 10px;
            display: none;
        }
    </style>
</head>
<body>

    <div class="container">
        <h1>HWID Generator</h1>
        <div class="hwid-display" id="hwid-box">HWID will appear here</div>
        <div class="btn-group">
            <button id="btn-get">Get HWID</button>
            <button id="btn-copy">Copy</button>
        </div>
        <div id="copy-status" class="success-msg">Copied to clipboard!</div>
    </div>
